import VideoList from './videolist';


export default class rightPanel extends React.Component {

  constructor(props) {
    super(props);
    this.state = {
      user: this.props.user,
    }
  }

    render(){
        return (

            <VideoList width='66.6%' user={this.state.user}/>


    );
    }

};
